import React, {Component} from 'react';
import './App.css';
import Header from './components/header';
import {
    Button
} from 'reactstrap';

class App extends Component {

    constructor(props) {
        super(props);

        this.state = {
            resultdata: '',
            chkSuchit: true,
            chkPortfolio: false
        }
    }


    render() {
        return (
            <React.Fragment>
                <Header/>

                <main role="main">
                    <section className="jumbotron">
                        <div className="row">

                            {/*Selection Bar Section*/}
                            <div className="col-md-3" id="selectOption">
                                <h1 className="jumbotron-heading">Select Option</h1>
                                <div className="hrBottom"></div>

                                <div className="row">
                                    <div className="col-md-4">
                                        <div className="custom-control custom-checkbox mr-sm-2">
                                            <input type="checkbox" className="custom-control-input" id="chkSuchit"
                                                   name="chkSuchit"
                                                   checked={this.state.chkSuchit}
                                                   onChange={this.dataChange.bind(this)}
                                                   value={this.state.chkSuchit}/>
                                            <label className="custom-control-label"
                                                   htmlFor="chkSuchit">Suchit</label>
                                        </div>
                                    </div>
                                    <div className="col-md-8">
                                        <div className="custom-control custom-checkbox mr-sm-2">
                                            <input type="checkbox" className="custom-control-input" id="chkPortfolio"
                                                   name="chkPortfolio"/>
                                            <label className="custom-control-label"
                                                   htmlFor="chkPortfolio">Portfolio</label>
                                        </div>
                                    </div>
                                </div>
                            </div>

                            {/*Result Section*/}
                            <div className="col-md-9">
                                <h1 className="jumbotron-heading">Result</h1>
                                <div className="hrBottom"></div>
                                <p className="">
                                    {this.state.resultdata}
                                </p>
                            </div>
                        </div>
                    </section>
                </main>
            </React.Fragment>
        );
    }
}

export default App;
